import models.Product;

/**
 * Created by NgocTri on 10/22/2016.
 */

public class GridViewAdapter extends ArrayAdapter<Product> {
    public GridViewAdapter(Context context, int resource, List<Product> objects) {
        super(context, resource, objects);
    }

    @Override
    public int getCount() {
        return super.getCount();
    }
    @NonNull
    @Override
    public View getView(int position, View convertView,@NonNull  ViewGroup parent) {
        final ViewHolder viewHolder;
        View v = convertView;

        if(null == v) {
            LayoutInflater inflater = (LayoutInflater)getContext().getSystemService(Context.LAYOUT_INFLATER_SERVICE);
            v = inflater.inflate(R.layout.grid_item, null);
            viewHolder = new ViewHolder(v);
        }else{
            viewHolder = (ViewHolder) convertView.getTag();
        }

        Animation startAnimation = AnimationUtils.loadAnimation(getContext(), R.anim.bounce);
        final Product product = getItem(position);
        ImageView img = (ImageView) v.findViewById(R.id.imageView);
        TextView txtTitle = (TextView) v.findViewById(R.id.txtTitle);
        TextView txtPrice = (TextView) v.findViewById(R.id.txtPrice);
        ImageView plus = (ImageView) v.findViewById(R.id.plus);
        ImageView minus = (ImageView) v.findViewById(R.id.minus);

        img.setImageResource(product.getImageId());
        txtTitle.setText(product.getTitle());
        txtPrice.setText(product.getPrice());
        Log.v("Position ", "Position :- "+position + " :"+product.getTitle());
        plus.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                int quantity = product.getQuantity(); // get the quantity for this row item
                product.setQuantity(quantity + 1); // update it by adding 1
//                viewHolder.quantityTxt.setText( "" +(quantity+1)); // set the new description (that uses the updated qunatity)
                Toast.makeText(getContext(),"Produk :  "+product.getTitle() +" Ditambah :"+ (quantity+1), Toast.LENGTH_SHORT).show();
            }
        });
        minus.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                int quantity = product.getQuantity(); // get the quantity for this row item
                if(quantity >0) {
                    product.setQuantity(quantity - 1); // update it by adding 1
//                    viewHolder.quantityTxt.setText( "" +(quantity-1)); // set the new description (that uses the updated qunatity)
                    Toast.makeText(getContext(), "Produk :  " + product.getTitle() + " Dikurang :" + (quantity - 1), Toast.LENGTH_SHORT).show();
                }
            }
        });
        img.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                Toast.makeText(getContext(),"Bisa", Toast.LENGTH_SHORT).show();

            }
        });

        return v;
    }

    private class ViewHolder {
        public TextView quantityTxt;

        public ViewHolder(View convertView) {
            quantityTxt  = (TextView) convertView.findViewById(R.id.quantityTxt);
        }
    }

}

